import React from 'react';
import './index.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Login from './pages/Login';
import AddTrip from './pages/AddTrip';
import Signup from './pages/Signup';
import Settings from './pages/Settings';
import Home from './pages/Home';
import logo from './logo.png';

class App extends React.Component {
  render() {
    return (
      <Router>
        <div className="container">

          <nav className="navbar navstyle">
            <a className="navbar-brand float-left" href="#">
              <img src={logo} height="50" width="100" alt="journey" />
            </a>
            <Link to="/" className="navbar-brand float-left">Home</Link>
            <Link to="/new-trip" className="navbar-brand">New Trip</Link>
            <Link to="/settings" className="navbar-brand">Settings</Link>
            <Link to="/logout" className="navbar-brand">Log Out</Link>
          </nav>

          <Route path="/" exact component={Home} />
          <Route path="/login" exact component={Login} />
          <Route path="/logout" exact component={Login} />
          <Route path="/new-trip" exact component={AddTrip} />
          <Route path="/signup" exact component={Signup} />
          <Route path="/settings" exact component={Settings} />
        </div>
      </Router>
    );
  }
}

export default App;
